import React from "react";
import "../index.css";
import Editor from "./Editor";

function App() {
  return (
    <>
      <div className="pane top-pane">
        <Editor language="xml" dip />
        <Editor />
        <Editor />
      </div>
      <div className="pane">
        <iframe
          title="output"
          sandbox="allow-scripts"
          frameBorder="0"
          width="100%"
          height="100%"
        />
      </div>
    </>
  );
}

export default App;
